043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0438\u0441\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BA%D0%BB%D1%8F%D1%80%D0%BE%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%92%D0%B8%D1%82%D0%B0%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043a\u043b\u044f\u0440\u043e\u0432, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u0412\u0438\u0442\u0430\u043b\u044c\u0435\u0432\u0438\u0447\">\u0414\u043c\u0438\u0442\u0440\u0438\u044f \u0421\u043a\u043b\u044f\u0440\u043e\u0432\u0430<\/a> \u0438 \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab\u042d\u043b\u043a\u043e\u043c\u0441\u043e\u0444\u0442\u00bb, \u043e\u0431\u0432\u0438\u043d\u044f\u0435\u043c\u044b\u0445 \u0432 \u0441\u043d\u044f\u0442\u0438\u0438 \u0437\u0430\u0449\u0438\u0442\u044b \u0441 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u0438\u0445 \u043f\u0440\u043e\u0434\u0443\u043a\u0442\u043e\u0432 \u0444\u0438\u0440\u043c\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Adobe_Systems\" title=\"Adobe Systems\">Adobe<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u041f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B1%D0%B0%D1%80%D0%BE%D0%B2%D1%81%D0%BA\" title=\"\u0425\u0430\u0431\u0430\u0440\u043e\u0432\u0441\u043a\">\u0425\u0430\u0431\u0430\u0440\u043e\u0432\u0441\u043a\u043e\u043c<\/a> \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u0443\u043d\u0438\u043a\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u043e \u0441\u0432\u043e\u0435\u0439 \u043f\u0440\u043e\u0442\u044f\u0436\u0451\u043d\u043d\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D0%B1%D0%B0%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D1%81%D1%82\" title=\"\u0425\u0430\u0431\u0430\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u043e\u0441\u0442\">\u043c\u043e\u0441\u0442<\/a> \u0447\u0435\u0440\u0435\u0437 \u0410\u043c\u0443\u0440\u0441\u043a\u0443\u044e \u043f\u0440\u043e\u0442\u043e\u043a\u0443. \u0415\u0433\u043e \u0434\u043b\u0438\u043d\u0430&#160;\u2014 750 \u043c\u0435\u0442\u0440\u043e\u0432. \u042d\u0442\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043f\u043e\u0434\u043e\u0431\u043d\u043e\u0435 \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438. \u041c\u043e\u0441\u0442 \u0431\u044b\u043b \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d \u0432 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u044b\u0435 \u0441\u0440\u043e\u043a\u0438&#160;\u2014 \u0432\u0441\u0435\u0433\u043e \u0437\u0430 \u043c\u0435\u0441\u044f\u0446.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2006_%D0%B3%D0%BE%D0%B4\" title=\"2006 \u0433\u043e\u0434\">2006<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u0430 \u043d\u043e\u0432\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f (\u0441\u0442\u0430\u043d\u0446\u0438\u044f \u043c\u0435\u0442\u0440\u043e, \u041c\u043e\u0441\u043a\u0432\u0430)\">\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u043